all_spikes = load(full_path); % Load the .mat file %[output:89587f23]
all_spikes = all_spikes.all_spikes;
Fnew = all_spikes(:,1:(size(all_spikes,2)-2),:);
all_spikes = zeros(size(Fnew,1),size(Fnew,2),size(Fnew,3));
all_spikes(:,:,:) = Fnew(:,:,:);

