for i = 1:length(sources)
    s = sources{i};
    if strcmp(s.Function, 'cMEM')
        cMEM_sources{end+1} = s;
    elseif strcmp(s.Function, 'wMEM')
        wMEM_sources{end+1} = s;
    end
