region_table_spike = sortrows(region_table_spike, 'Count', 'descend');


%% Show the tables in Live Script
disp('ðŸ§  Region_Label Counts:'); %[output:4fb9209b]
disp(region_table_spike); %[output:57374106]
% Set full file path
filename = fullfile(folder_path, "region_table_spike.txt");

% Write the table to CSV
writetable(region_table_spike, filename);


%% Plotting the top 10 from each category
figure; %[output:401f7be1]
barh(region_table_spike.Count(1:5)); %[output:401f7be1]
set(gca, 'yticklabel', region_table_spike.Region(1:5)); %[output:401f7be1]
xlabel('Count'); %[output:401f7be1]
title('Top 10 Region\_Label'); %[output:401f7be1]
grid on; %[output:401f7be1]
